import React, { Component } from 'react'
import Navbar from "../Navbar/Navbar"
import Sidebar from '../Sidebar/Sidebar'
import Card from '../car'


export default class Dashboard extends Component {
    render() {
        return (
            <React.Fragment>
           <Navbar/>
           <Sidebar/>
           <Card></Card>
           </React.Fragment>
        )
    }
}
